5.Red Sky - 27 juli 2001 - - Carter heeft een beveiligingfunctie uitgeschakeld en daardoor 'vervuilen' ze de zon van een planeet die daardoor supernova gaat. Ze vragen de Asgard om hulp.

6.Rite of Passage - 3 augustus 2001 - - Cassandra die ondertussen de leeftijd van een tiener heeft bereikt wordt ernstig ziek. De genezing ligt op de planeet waar ze vandaag komt.

7.Beast of Burden - 10 augustus 2001 - De Unas waar Daniel vriendschap mee heeft gesloten wordt door een groep jagers meegenomen naar een planeet waar Unassen slaven zijn.

8.The Tomb - 17 augustus 2001 - -De Russen vragen SG-1 om hulp nadat een archeologische team verdwenen is.

